.loading-spinner-large {
  position: relative;
  display: block;
  width: 64px;
  height: 64px;
  background-image: none;
  background: none;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-large::before {
  content: '';
