}
.tab-bar .tab.active {
  color: #dbe5ed;
  background-color: #181d22;
}
.tab-bar .tab .close-icon {
  transition: opacity .3s;
  opacity: 0.5;
}
.tab-bar .tab:not(:hover) .close-icon {
  opacity: 0;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
