  animation: tree-view-list-item-selected-before 1s;
}
@keyframes tree-view-list-item-selected-before {
  from {
    z-index: -1;
  }
  to {
    z-index: -1;
  }
}
.tree-view .list-item.selected::after {
  content: '';
  background-image: linear-gradient(to right, #2d3740, transparent);
  position: absolute;
  left: 16px;
  right: 0;
  height: 25px;
  opacity: 0;
  pointer-events: none;
  animation: tree-view-list-item-selected-after 1s;
}
@keyframes tree-view-list-item-selected-after {
  0% {
    transform: translateX(100%);
    opacity: 0;
    z-index: -1;
  }
  50% {
    transform: none;
    opacity: 0.3;
    z-index: -1;
    animation-timing-function: cubic-bezier(0.19, 1, 0.22, 1);
  }
  100% {
